import React from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import Todo_screen from "./pages/Todo_screen";

function App() {
  return (
    <Router>
      <div>
        <Switch>
          <Route path="/todo" component={Todo_screen} />
          {/* 다른 페이지의 Route도 여기에 추가할 수 있습니다 */}
        </Switch>
      </div>
    </Router>
  );
}

export default App;
